/* define adc sampling frequency */
#define WQ_VTB_ADC_SAMPLING_FREQ      12800
/* define the number of points processed by FFT each time */
#define WQ_VTB_LOAD_FFT_POINT_NUMBER  256
/* defines the size of the duplicate block for each FFT calculation */
#define WQ_VTB_LOAD_FFT_OVERLAP_LEN   0
/* define the effective data length involved in FFT calculation */
#define WQ_VTB_LOAD_FFT_DATA_LEN      \
    (WQ_VTB_LOAD_FFT_POINT_NUMBER - WQ_VTB_LOAD_FFT_OVERLAP_LEN)
/* define the transmission duration of each bit in the original data
 * [NOTE]:the actual value is 0.6s. In order to prevent compilation error,
 * it is expressed as 600ms, which needs to be converted to seconds
 * at the place of calling.
 */
#define WQ_VTB_LOAD_BIT_DURATION      600
/* define the maximum number of segments for ADC data, 6400 is the predefined
 * number of samples per process, 5 is the reserved array space.
 */
#define WQ_VTB_LOAD_SEGMENT_NUM_MAX   (6400 / WQ_VTB_LOAD_FFT_DATA_LEN + 5)
/* define the number of energy values corresponding to 1 bit */
#define WQ_VTB_LOAD_BIT_TO_ENERGY_NUM (WQ_VTB_LOAD_BIT_DURATION * \
    WQ_VTB_ADC_SAMPLING_FREQ / WQ_VTB_LOAD_FFT_DATA_LEN / 1000)
/* define the sliding window size of energy calculation, units is 2byte. */
#define WQ_VTB_LOAD_SLIDING_WIN_SIZE  WQ_VTB_LOAD_BIT_TO_ENERGY_NUM
/* defines the size of the sliding accumulation buffer, the units is 2byte */
#define WQ_VTB_LOAD_SUM_MOVE_BUF_SIZE (WQ_VTB_LOAD_SLIDING_WIN_SIZE * 4)
/* define the length of valid data, the units is byte */
#define WQ_VTB_LOAD_DATA_LEN          2
/* define time of complete data transmission, unit is ms.
 * the timeout allowed is half the length of the data.
 */
#define WQ_VTB_LOAD_COMPLETE_TIME     \
    (WQ_VTB_LOAD_BIT_DURATION * (WQ_VTB_LOAD_DATA_LEN * 8 / 2 * 3))
/* define the minimum difference value */
#define WQ_VTB_LOAD_DELTA_MIN         0
/* define the max and min difference multiple between valid data and noise */
#define WQ_VTB_LOAD_DELTA_MULTIPLE    2
/* define the raw data sent by the user */
#define WQ_VTB_LOAD_USER_DATA_KEY     0xAAE9

#if !defined(max)
#define max(a, b) (((a) > (b)) ? (a) : (b))
#endif

#if !defined(min)
#define min(a, b) (((a) < (b)) ? (a) : (b))
#endif

typedef struct _wq_vtb_load_decision_info_t {
    /* sliding buffer */
    uint16_t sliding_buf[WQ_VTB_LOAD_SLIDING_WIN_SIZE];
    /* sliding buffer index */
    uint8_t index;
    /* energy max value */
    uint16_t energy_max;
    /* energy min value */
    uint16_t energy_min;
    /* bit count */
    uint8_t bit_counter;
    /* error bit count */
    uint8_t err_bit_counter;
    /* start sliding accumulation flag */
    uint8_t start_sum_move_flag;
    /* current threshold of valid data */
    uint16_t threshold;
    /* average threshold of invalid data */
    uint16_t ave_noise;
    /* difference between last maximum and minimum of invalid data */
    uint16_t delta_last;
    /* sliding accumulation buffer */
    uint16_t sum_move_buf[WQ_VTB_LOAD_SUM_MOVE_BUF_SIZE];
    /* sliding accumulation buffer index */
    uint8_t index_sum;
    /* flag where the first bit is found  */
    uint8_t first_bit_flag;
    /* focus index */
    uint8_t index_focus;
    /* current bit */
    uint8_t curr_bit;
    /* next bit */
    uint8_t next_bit;
    /* start decode time */
    uint32_t time_start;
    uint16_t delta_first_bit;
} wq_vtb_load_decision_info_t;

typedef struct _wq_vtb_load_info_t {
    /* save the buffer of energy calculation results */
    uint16_t fft_energy_result[WQ_VTB_LOAD_SEGMENT_NUM_MAX];
    /* decode data buffer */
    uint8_t decode_data[WQ_VTB_LOAD_DATA_LEN];
    /* wq_vtb_load_decision_info_t handle */
    wq_vtb_load_decision_info_t decision;
} wq_vtb_load_info_t;

