/*
 *@func: wq_vtb_load_reset_decision - reset related flag bit.
 *@param: phase - data phase.
 */
static void wq_vtb_load_reset_decision(uint8_t phase, uint8_t clean_all)
{
    wq_vtb_load_decision_info_t *info = &load_info[phase].decision;

    /* always keep variables related to noise data,
     * including delta_last, threshold_ave_noise. sum_noise. count_noise.
     */
    info->bit_counter = 0;
    info->err_bit_counter = 0;
    info->first_bit_flag = 0;
    info->time_start = 0;
    if (clean_all) {
        info->index_sum = 0;
        memset(info->sum_move_buf, 0, WQ_VTB_LOAD_SUM_MOVE_BUF_SIZE * 2);
    }

    return;
}

/*
 *@func: wq_vtb_load_threshold_change - change threshold.
 *@param: info - wq_vtb_load_decision_info_t struct.
 *@param: delta - difference between current and last focus.
 *@return: 1 -> changed, 0 -> not changed.
 */
static uint8_t wq_vtb_load_threshold_change(uint8_t phase, uint32_t delta)
{
    int8_t move_point_num = 0;
    uint8_t move_dir = 0;
    uint8_t result = 0;
    int32_t delta_temp = 0;
    wq_vtb_load_decision_info_t *info = &load_info[phase].decision;

    delta_temp = delta % WQ_VTB_LOAD_BIT_TO_ENERGY_NUM;
    /* now we know that the first bit is 1,
     * and the delta value should be around WQ_VTB_LOAD_BIT_TO_ENERGY_NUM.
     */
    if (info->first_bit_flag == 1) {
        info->first_bit_flag++;
        if (delta_temp == 0) {
            goto out;
        }
        if (delta >= WQ_VTB_LOAD_BIT_TO_ENERGY_NUM) {
            move_point_num = delta_temp;
            move_dir = 0;
        } else {
            move_point_num = WQ_VTB_LOAD_BIT_TO_ENERGY_NUM - delta;
            move_dir = 1;
        }
    } else {
        /* after the first bit correction, the subsequent bit difference should
         * be within plus or minus (WQ_VTB_LOAD_BIT_TO_ENERGY_NUM / 2).
         */
        if (delta_temp == 0) {
            goto out;
        }
        if (delta_temp > WQ_VTB_LOAD_BIT_TO_ENERGY_NUM / 2) {
            move_point_num = WQ_VTB_LOAD_BIT_TO_ENERGY_NUM - delta_temp;
            move_dir = 1;
        } else {
            move_point_num = delta_temp;
            move_dir = 0;
        }
    }
    move_point_num = move_point_num / 2;
    move_point_num = move_dir ? move_point_num : (0 - move_point_num);
//    info->threshold = (info->sum_move_buf[info->index_focus] +
//        info->sum_move_buf[info->index_focus + move_point_num]) / 2;
    info->threshold = info->sum_move_buf[info->index_focus + move_point_num];
    wq_dbg_printf("move point num:%d, dir:%d, new threshold:%d\n",
        move_point_num, move_dir, info->threshold);
    result = 1;
out:
    return result;
}

static uint8_t wq_vtb_load_find_first_bit(uint8_t phase, uint16_t delta)
{
    uint8_t result = 0;
    uint32_t sum_noise = 0;
    uint16_t j = 0;
    wq_vtb_load_decision_info_t *info = &load_info[phase].decision;
    uint8_t *decode_data = load_info[phase].decode_data;

    for (j = 0; j < WQ_VTB_LOAD_SUM_MOVE_BUF_SIZE; j++) {
        sum_noise += info->sum_move_buf[j];
    }
    info->threshold = (info->energy_max + info->energy_min) / 2;
    wq_dbg_printf("phase:%d, max:%d, min:%d, delta_energy:%d, threshold:%d,"
        " delta_last:%d, noise_ave:%d", phase, info->energy_max,
        info->energy_min, delta, info->threshold, info->delta_last,
        info->ave_noise);
    /* we think that the energy value corresponding to the effective data
        * is far greater than that corresponding to the noise, but there is
        * a case that the array only contains half of the effective data.
        * Therefore, we think that when the energy value is greater
        * than twice the last energy value, the first bit appears.
        */
    if ((info->delta_last != 0) && (delta >= WQ_VTB_LOAD_DELTA_MIN)
        && (delta > WQ_VTB_LOAD_DELTA_MULTIPLE * info->delta_last)) {
        uint8_t less_threshold = 0;
        uint16_t index_max = 0;
        uint16_t move_num = 0;
        /* find the position of the maximum value in the array */
        for (j = 0; j < WQ_VTB_LOAD_SUM_MOVE_BUF_SIZE; j++) {
            if (info->sum_move_buf[j] == info->energy_max) {
                index_max = j;
                break;
            }
        }
        /* find first focus */
        for (j = 0; j < WQ_VTB_LOAD_SUM_MOVE_BUF_SIZE; j++) {
            if (info->sum_move_buf[j] <= info->threshold
                && info->sum_move_buf[j + 1] >= info->threshold) {
                info->index_focus = j;
                break;
            }
        }
        /* if the maximum value or intersection position is too
            * backward, wait for more data to judge.
            */
        move_num = min((WQ_VTB_LOAD_SUM_MOVE_BUF_SIZE - index_max),
            (WQ_VTB_LOAD_SUM_MOVE_BUF_SIZE - info->index_focus));
        if (move_num != 0 && move_num < WQ_VTB_LOAD_BIT_TO_ENERGY_NUM) {
            move_num = WQ_VTB_LOAD_BIT_TO_ENERGY_NUM - move_num;
            wq_dbg_printf("phase:%d, index max:%d, index focus:%d, waiting "
                "for %d data to judges", phase, index_max,
                info->index_focus, move_num);
            memcpy(info->sum_move_buf, &info->sum_move_buf[move_num],
                (WQ_VTB_LOAD_SUM_MOVE_BUF_SIZE - move_num) * 2);
            info->index_sum -= move_num;
            goto out;
        }
        /* discard the invalid data.
            * move the data in the focus position to the beginning of the array.
            */
        memcpy(info->sum_move_buf, &info->sum_move_buf[info->index_focus],
            ((WQ_VTB_LOAD_SUM_MOVE_BUF_SIZE - info->index_focus) * 2));
        info->index_sum = WQ_VTB_LOAD_SUM_MOVE_BUF_SIZE - info->index_focus;

        /* if the focus data and its subsequent data are less than the mean
            * value of noise threshold, the data will be considered invalid.
            */
        for (uint8_t i = 0; i < WQ_VTB_LOAD_SLIDING_WIN_SIZE; i++) {
            if (info->sum_move_buf[i] < info->ave_noise) {
                less_threshold++;
            }
        }
        if (less_threshold > 0) {
            wq_dbg_printf("phase:%d, first focus invalid, less counter:%d\n",
                phase, less_threshold);
            /* in order to avoid entering the infinite loop,
                * we need to discard the focus data and some subsequent data
                */
            memcpy(info->sum_move_buf,
                &info->sum_move_buf[WQ_VTB_LOAD_SLIDING_WIN_SIZE],
                WQ_VTB_LOAD_SLIDING_WIN_SIZE * 2);
            info->index_sum -= WQ_VTB_LOAD_SLIDING_WIN_SIZE;
        } else {
            wq_dbg_printf("phase:%d, first focus find, sum:%d : %d, "
                "index:%d\n", phase, info->sum_move_buf[info->index_focus],
                info->sum_move_buf[info->index_focus +1], info->index_focus);
            info->curr_bit = 1;
            info->next_bit = 0;
            info->first_bit_flag = 1;
            info->time_start = 0;
            info->delta_first_bit = delta;
            memset(decode_data, 0, WQ_VTB_LOAD_DATA_LEN * 2);
            result = 1;
        }
    } else {
        if (info->delta_last == 0) {
            info->delta_last = delta;
            info->ave_noise = sum_noise / WQ_VTB_LOAD_SUM_MOVE_BUF_SIZE;
        } else {
            sum_noise = sum_noise / WQ_VTB_LOAD_SUM_MOVE_BUF_SIZE;
            info->delta_last = (info->delta_last * 8 + delta *2) / 10;
            info->ave_noise = (info->ave_noise * 9 + sum_noise) / 10;
        }
        info->index_sum = 0;
    }

out:
    return result;
}

/*
 *@func: wq_vtb_load_bit_decision - decode bit information.
 *@param: phase - data phase.
 *@param: sum_value - cumulative value of energy.
 *@return: decode flag.
 */
static uint8_t wq_vtb_load_bit_decision(uint8_t phase, uint16_t sum_value)
{
    uint8_t flag = 0;
    uint16_t j = 0;
    uint32_t delta_timer = 0;
    uint16_t delta_energy = 0, delta_foucs = 0;
    uint8_t bit_num = 0;
    wq_vtb_load_decision_info_t *info = &load_info[phase].decision;
    uint8_t *decode_data = load_info[phase].decode_data;
    uint32_t time_now = 0;
    uint8_t bit_num_temp = 0;
    uint8_t change_threshold_enable = 1;
    (void)bit_num_temp;

    info->sum_move_buf[info->index_sum] = sum_value;
    info->index_sum++;

    /* when the buffer is full, the decision is started */
    if (info->index_sum < WQ_VTB_LOAD_SUM_MOVE_BUF_SIZE) {
        goto out;
    }

    if (info->first_bit_flag) {
        time_now = 1;
        delta_timer = (time_now > info->time_start) ? (time_now - info->time_start) :
            (0xffffffff - info->time_start + time_now);
        if (delta_timer > WQ_VTB_LOAD_COMPLETE_TIME * 1000) {
            wq_dbg_printf("phase:%d, timer start:%d, timer over:%d, delta:%d \n",
                phase, info->time_start, time_now, delta_timer);
            wq_info_printf("phase:%d, over time, reset buffer\n", phase);
            wq_vtb_load_reset_decision(phase, 1);
            goto out;
        }
    }

    /* calculate the maximum and minimum value in the current buffer */
    info->energy_min = 0xffff;
    info->energy_max = 0;
    for (j = 0; j < WQ_VTB_LOAD_SUM_MOVE_BUF_SIZE; j++) {
        info->energy_max = max(info->sum_move_buf[j], info->energy_max);
        info->energy_min = min(info->sum_move_buf[j], info->energy_min);
    }
    delta_energy = info->energy_max - info->energy_min;

    if (info->first_bit_flag == 0) {
        (void)wq_vtb_load_find_first_bit(phase, delta_energy);
    } else {
        /* the energy difference of valid data must be greater than
         * 1/(WQ_VTB_LOAD_DELTA_MULTIPLE) of the difference of the first bit.
         */
        if (info->bit_counter < (WQ_VTB_LOAD_DATA_LEN * 8)) {
            if (delta_energy * WQ_VTB_LOAD_DELTA_MULTIPLE <
                info->delta_first_bit) {
                wq_dbg_printf("phase:%d, abnormal energy value:%d, "
                    "first energy:%d", phase, delta_energy, info->delta_first_bit);
                wq_vtb_load_reset_decision(phase, 1);
            }
        }
        for (j = 2; j < WQ_VTB_LOAD_SUM_MOVE_BUF_SIZE; j++) {
            /* positive slope indicates Bit1, negative slope indicates bit0 */
            if (info->next_bit) {
                if (info->sum_move_buf[j] <= info->threshold
                    && info->sum_move_buf[j + 1] >= info->threshold) {
                    info->index_focus = j;
                } else {
                    continue;
                }
            } else {
                if (info->sum_move_buf[j] >= info->threshold
                    && info->sum_move_buf[j + 1] <= info->threshold) {
                    info->index_focus = j;
                } else {
                    continue;
                }
            }
            delta_foucs = info->index_focus - 2;
            bit_num = delta_foucs / WQ_VTB_LOAD_BIT_TO_ENERGY_NUM +
                ((delta_foucs % WQ_VTB_LOAD_BIT_TO_ENERGY_NUM >
                (WQ_VTB_LOAD_BIT_TO_ENERGY_NUM / 2)) ? 1 : 0);
            bit_num_temp = bit_num;
            if (bit_num == 0) {
                info->err_bit_counter++;
                wq_dbg_printf("phase:%d, find bad focus, index:%d, delta:%d\n",
                    phase, info->index_focus, delta_foucs);
                continue;
            }
            wq_dbg_printf("phase:%d, find focus, index:%d, delta:%d, curr_bit:%d, "
                "bit_num:%d, bit_counter:%d\n", phase, info->index_focus,
                delta_foucs, info->curr_bit, bit_num_temp, info->bit_counter);
            /* re judge threshold, each bit is allowed to adjust the
             * threshold once, but the first bit may have large error
             * and needs special treatment(provided the first bit is known).
             */
            if (change_threshold_enable) {
                change_threshold_enable = 0;
                if (wq_vtb_load_threshold_change(phase, delta_foucs)) {
                     /* retrieve intersections again using the new threshold */
                     j = 2;
                    continue;
                }
            }
            while (bit_num)
            {
                decode_data[info->bit_counter / 8] =
                    (decode_data[info->bit_counter / 8] << 1) | info->curr_bit;
                info->bit_counter++;
                bit_num--;
            }

            info->curr_bit = (info->curr_bit == 0) ? 1 : 0;
            info->next_bit = (info->next_bit == 0) ? 1 : 0;
            memcpy(info->sum_move_buf, &info->sum_move_buf[j],
                (WQ_VTB_LOAD_SUM_MOVE_BUF_SIZE - j) * 2);
            info->index_sum = WQ_VTB_LOAD_SUM_MOVE_BUF_SIZE - j;

            break;
        }
        if (info->bit_counter == 4) {
            if ((decode_data[0] & 0x0F) != 0x0A) {
                 wq_info_printf("phase:%d, get err preamble, reset buffer, data:",
                    phase);
                wq_vtb_load_reset_decision(phase, 0);
            }
        }
        if (info->bit_counter >= WQ_VTB_LOAD_DATA_LEN * 8) {
            flag = 1;
            wq_info_printf("phase:%d, get complete data, reset buffer, data:",
                phase);
            for (uint8_t i = 0; i < WQ_VTB_LOAD_DATA_LEN; i++) {
                wq_dbg_printf("0x%02X ", decode_data[i]);
            }
            wq_dbg_printf("\n");

            wq_vtb_load_reset_decision(phase, 1);
        }
    }

out:
    return flag;
}

